profile:
TopLine a Canadian-owned contracting company based in Sault Ste. Marie, Ontario, specializing in electrical, plumbing and heating & cooling. We provide service to residential, commercial and industrial customers. 

Experience ranges from:

*Emergency and after hour service for residential and commercial customers;
*New residential home construction and renovations;
*Ongoing residential and commercial maintenance contracts;
*Large commercial infrastructure projects; and
*Renewable energy projects, including solar, wind and hydro.  
*We service Sault Ste Marie, and surrounding communities, including Wawa, and White River, and *remote communities where we have a long-standing history of quality work.  Our head office is *located in Sault Ste. Marie, Ontario but pride ourselves on servicing surrounding communities *lacking contracting skill set in their respective areas.

Our staff of fully licensed electricians, HVAC technicians and plumbers possess years of experience.  We have committed professionals with the highest qualifications for the trade, including Master Electricians, Master Plumbers, licensed Red Seal Refrigeration and Sheet Metal technicians and Oil and Gas Technicians possessing G3, G2, and G1 licenses, to tackle any job.

We guarantee professional, clean and quality craftsmanship.
